Key
(1) MMCC suppliers data; All are pitch‐based products and are milled before carbonising;  
(2) Milled fibres A and B are produced from the same resin as Cytec P‐120;  
(3) Milled fibres C and D are produced from the same resin as Cytec K1100;  
(4) L ‐ Longitudinal (listed as ‘axial’ in supplier’s data);  
(5) T ‐ Transverse
